import memeFace from "../images/meme-face.png";

export default function Navbar() {
    return (
      <nav className="navigation">
        <div className="nav-left">
          <img src={memeFace} alt="meme face" />
          <h1>Meme Generator</h1>
        </div>
        <div className="nav-right"></div>
      </nav>
    );
}
